import React from 'react';
import './News.css';

const News = () => {
    return (
        <div className='container'>
            <h5 className='pt-1'>আপনার কৃষিভিত্তিক যাবতীয় সমস্যা আমাদের জানাতে মেসেন্জার বাটনে ক্লিক করুন, হটলাইন নম্বর : ০১৯৭৪৯৫৩৪৮৬</h5>
             </div>


    );
};

export default News;
